import './Login.css'
import MovieBox from './MovieBox'
import axios from 'axios'
const Login = () => {

const [list, setList]= useState()

useEffect(() =>{
   axios
   .get(`https://api.themoviedb.org/3/trending/all/day?api_key=977eefe575b9168b5e7fd6e6fabc58f1&language=en-US&page=1`)  
  //  .get(`https://api.themoviedb.org/3/movie/top_rated?api_key=977eefe575b9168b5e7fd6e6fabc58f1&language=en-US&page=1`)  
   .then(({data}) => setList(data.results))
   .catch((err) => console.log(err))
},[])

  return (
      <div className="card">
        <div className="card-img-">  
          {
            list && list.map((list) => <MovieBox list ={list} />)
          }
        
        </div>
          </div>
        
  
    
    
  )
}

export default Login
